%angular
<div id="fps_payment_report">
    <form name="searchPaymentForm" id="searchPaymentForm">
        <div class="form-group">
            <div class="row">
                <div class="col-xs-3 form-group">
                    <label for="settlementCycle">Settlement Cycle: </label>
                    <input type="text" class="form-control" id="settlementCycle" ng-model="data.settlementCycle"></input>
                </div>
            </div>
            <div class="row">
                <div class="col-xs-3 form-group">
                    <label for="creditorSortcode">Creditor sortcode: </label>
                    <input class="form-control" type="text" name="creditorSortcode" id="creditorSortcode" ng-model="data.creditorSortcode"></input>
                </div>
                <div class="col-xs-3 form-group">
                    <label for="debtorSortcode">Debtor sortcode: </label>
                    <input class="form-control" type="text" name="debtorSortcode" id="debtorSortcode" ng-model="data.debtorSortcode"></input>
                </div>
            </div>
            <div class="row">
                <div class="col-xs-3 form-group">
                    <label for="startDate">Start Date: </label>
                    <input class="form-control" type="date" name="startDate" id="startDate" ng-model="data.startDate"></input>
                </div>
                <div class="col-xs-3 form-group">
                    <label for="endDate">End Date: </label>
                    <input class="form-control" type="date" name="endDate" id="endDate" ng-model="data.endDate"></input>
                </div>
            </div>
        </div>
        <button type="submit" class="btn btn-primary" ng-click="doQuery()"> Search</button>
    </form>
    <div class="clear-form-button">
        <button class="btn" ng-click="clearForm()">Clear Form</button>
    </div>
</div>
<script>

    angular.element(document).ready(function () {
        console.log('init');
        init_fps_payment_report();
    });

    function init_fps_payment_report(){

    console.log('init payment report');
    var scope = angular.element($("#fps_payment_report")).scope();

    scope.queryString = "";
    scope.data = {};

    scope.clearForm = function(){
        var scope = angular.element($("#fps_payment_report")).scope();
        scope.data = {};
    }

    scope.doQuery = function(){
        var scope = angular.element($("#fps_payment_report")).scope();
         var startDateQuery = "";
        var endDateQuery = "";
        if (scope.data.startDate != "" && scope.data.startDate != null) {
            var startDateElement = document.getElementById('startDate').value;            
            startDateQuery = "\'" + startDateElement + "\'";
        }
        if (scope.data.endDate != "" && scope.data.endDate != null) {
            var endDateElement = document.getElementById('endDate').value;
            endDateQuery = "\'" + endDateElement + "\'";

        }

        var values = [scope.data.settlementCycle, startDateQuery,  endDateQuery, scope.data.creditorSortcode, scope.data.debtorSortcode];

        var queryFields = ['"cycle_id" = ', '"settelment_date" >= ', '"settelment_date" <= ','"creditor_sortcode" = ', '"debtor_stortcode" = '];

        var queryValues = queryFields.map(function(e, i) {
            var field = e;
            var value = values[i]
            if (value === null || typeof(value) == 'undefined' || value === "" || value == "'%%'"){
                return "";
            }
            if(field.includes("date")){
                value = "TO_TIMESTAMP("+value+")";            
            }else{
                value = "'"+value+"'";
            }        
            return e + value;
        });
        var notEmptyQueryValues = queryValues.filter(function check(c) { if (c === "") {return false} return true });

        var queryString = "";
        if (notEmptyQueryValues.length != 0){
            queryString = "and " + notEmptyQueryValues.join(" and ");
        }
        scope.queryString = queryString;
        console.log(scope.queryString);
        scope.z.angularBind('searchFPSPaymentReportQuery', scope.queryString,'20181130-135625_376593354');
        scope.z.runParagraph('20181130-135625_376593354');

        scope.z.angularBind('searchFPSPaymentReportQuery', scope.queryString,'20181204-230252_1920202094');
        scope.z.runParagraph('20181204-230252_1920202094');

        scope.z.angularBind('searchFPSPaymentReportQuery', scope.queryString,'20181204-230335_137681482');
        scope.z.runParagraph('20181204-230335_137681482');

        }
}



</script>
<style media="screen" type="text/css">
.clear-form-button{
    display: inline;
    float: right;
}

#fps_total_report {
    width: 98%;
}
</style>
